int main() {
    string agency;
    getline(cin, agency);

    int ticket, kidTicket;
    cin >> ticket >> kidTicket;

    double ticketPrice, service;
    cin >> ticketPrice >> service;

    double totalAdult = (ticketPrice + service) * ticket;
    double totalKid = (0.3 * ticketPrice + service) * kidTicket;
