void fiveInOne(ll n)
{
    ll arr[n] = {0};
    for (int i = 0; i < n; i++)
    {
        cin >> arr[i];
    }
    ll mx = 0;
    ll mn = mod;
    ll numOfPrimes = 0;
    ll numOfPalindrome = 0;
    int res = 0;
    int idx = 0;

    for (int i = 0; i < n; i++)
    {
        // Get the maximum number
        if (arr[i] > mx)
        {
            mx = arr[i];
        }
        // Get the minimum number
        if (arr[i] < mn)
        {
            mn = arr[i];
        }
        // Check how many prime numbers
        bool isPrime = true;
        if (arr[i] != 1)
        {
            for (int j = 2; j < sqrt(arr[i]); j++)
            {
                if (arr[i] % j == 0 && arr[i] != 2)
                {
                    isPrime = false;
                    break;
                }
            }
            if (isPrime)
            {
                numOfPrimes++;
            }
        }
        // Ckeck how many palindrome
        string str = to_string(arr[i]);
        string rev = str;
        reverse(rev.begin(), rev.end());
        if (str == rev)
        {
            numOfPalindrome++;
        }
        // Check the number that has the maximum number of divisors
        int divisors = 0;
